"The aftermath of a garden party” – A special project by Loji Höskuldsson in collaboration with HAY for CHART Art Fair 2021

HAY and CHART join forces in a creative collaboration centred around the delicate, nostalgic embroidery practice of the Icelandic artist Loji Höskuldsson. The artist creates a poetic, embroidered landscape on a 10-metre-long HAY Mags Soft sofa; setting the stage for talks and book signings during CHART’s art book fair. Don't miss it! The fair is running from tomorrow until Sunday 29 August.

